import React from "react";
import { Table } from "react-bootstrap";

function GoalSetting () {
    return(
        <div>
            <Table>
                <thead>
                    <tr>
                        <th>Project Name</th>
                        <th>Progress</th>
                        <th>Status</th>
                    </tr>
                </thead>
            </Table>
        </div>
    );
}

export default GoalSetting;
